// src/Components/MainList.js

import React from "react";

const MainList = ({ pokemons, onDelete, onDuplicate }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Type</th>
          <th>Location</th>
          <th className="actions-column">Actions</th> {/* Add the actions-column class */}
        </tr>
      </thead>
      <tbody>
        {pokemons.map((pokemon) => (
          <tr key={pokemon.id}>
            <td>{pokemon.name}</td>
            <td>{pokemon.type}</td>
            <td>{pokemon.location}</td>
            <td className="actions-column">
              <button onClick={() => onDelete(pokemon.id)}>Delete</button>
              <button onClick={() => onDuplicate(pokemon)}>Duplicate</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MainList;
